import * as React from "react";

import logo from "../../assets/images/logo.svg";
import search from "../../assets/images/logo.svg";
import icons from "../../assets/images/logo.svg";

import "../../css/components/navigation.scss";

const TopNav = () => {
  return (
    <section className="top-nav">
      <img src={logo}></img>
      <img src={search}></img>
      <img src={icons}></img>
    </section>
  )

